const dayjs = require('dayjs');
var duration = require('dayjs/plugin/duration')
dayjs.extend(duration);

function timeWorked(input) {
    const start  = input.employee_clock_in;
    const end = input.employee_clock_out;
    var duration = dayjs(end).diff(dayjs(start), 'hour', true);
}

module.exports = {
    timeWorked
}
